import bgImage from "./assets/bg.jpg"; // Background Image Import
import buttonlogo from "./assets/buttonlogo.png"; // Button Logo Import
import coinlogo from "./assets/coinlogo.png"; // Coin Logo Import
import { useState } from "react";

const MyComponent = () => {
  const [page, setPage] = useState(1);
  const levels = ["1", "2", "3", "4", "5", "6"];
  const rewards = ["10$", "20$", "30$", "40$", "50$", "60$"];
  const requirements = ["Low", "Medium", "High", "Very High", "Extreme", "Max"];
  const itemsPerPage = 3;
  const startIndex = (page - 1) * itemsPerPage;
  const endIndex = startIndex + itemsPerPage;
  const totalPages = Math.ceil(levels.length / itemsPerPage);

  return (
    <div
      style={{ backgroundImage: `url(${bgImage})` }}
      className="h-screen w-full bg-cover bg-center p-4"
    >
      {/* Login Section */}
      <div className="max-w-3xl mx-auto bg-green-600 text-white p-6 rounded-xl text-center">
        <h3 className="text-xl font-bold">Login / Register now become JAYA9 VIP</h3>
        <p className="font-bold">Get the Benefits Now</p>
        <div className="flex flex-col sm:flex-row gap-4 justify-center mt-4">
          <button className="border border-white px-4 py-2 hover:border-orange-500 rounded-sm">
            প্রবেশ করুন
          </button>
          <button className="bg-orange-500 px-8 py-2 rounded-sm">নিবন্ধন</button>
        </div>
      </div>

      {/* Table Section */}
      <div className="overflow-x-auto mt-6">
        <table className="w-full text-center bg-zinc-800 text-white rounded-lg overflow-hidden">
          <tbody>
            {/* Levels Row */}
            <tr className="bg-black">
              <td className="py-4">স্তর</td>
              {levels.slice(startIndex, endIndex).map((level, i) => (
                <td key={i} className="p-2 relative">
                  <img src={buttonlogo} alt="Level" className="mx-auto w-10 h-10" />
                  <span className="absolute inset-0 flex items-center justify-center font-bold">
                    {level}
                  </span>
                </td>
              ))}
            </tr>

            {/* Rewards Row */}
            <tr className="bg-black">
              <td className="py-4">পুরস্কার</td>
              {rewards.slice(startIndex, endIndex).map((reward, i) => (
                <td key={i} className="p-2">
                  <img src={coinlogo} alt="Coin" className="mx-auto w-8 h-8 mb-1" />
                  {reward}
                </td>
              ))}
            </tr>

            {/* Requirements Row */}
            <tr className="bg-black">
              <td className="py-4">প্রয়োজনীয়তা</td>
              {requirements.slice(startIndex, endIndex).map((requirement, i) => (
                <td key={i} className="p-2">{requirement}</td>
              ))}
            </tr>
          </tbody>
        </table>
      </div>

      {/* Pagination */}
      <div className="flex justify-center mt-4">
        <div className="flex bg-zinc-800 px-6 py-2 rounded">
          <button onClick={() => setPage(page - 1)} disabled={page === 1} className="px-4 py-2">
            ◀
          </button>
          {Array.from({ length: totalPages }, (_, i) => (
            <button
              key={i + 1}
              className={`px-4 py-2 mx-1 ${page === i + 1 ? "bg-blue-500" : ""}`}
              onClick={() => setPage(i + 1)}
            >
              {i + 1}
            </button>
          ))}
          <button onClick={() => setPage(page + 1)} disabled={page === totalPages} className="px-4 py-2">
            ▶
          </button>
        </div>
      </div>
    </div>
  );
};

export default MyComponent;
